import React from 'react';
import Header from '../../../../commonComponents/header/Header';
import PageLayout from '../../../layouts/pageLayout/PageLayout';
import {Link} from 'react-router-dom'
// import style from './assemblyVideos.module.css';

export default function AssembliesVideos() {
  return (
    <PageLayout>
      <Header h1Heading='Assemblies Videos' />
      <article>
        <h2>Assembly The Motherboard</h2>
        <Link  className={style.link}
              to='https://en.wikipedia.org/wiki/List_of_Intel_processors'
              target='blank' className={style.link}
              to='https://en.wikipedia.org/wiki/List_of_Intel_processors'
              target='blank'/>
      </article>
    </PageLayout>
  );
}
